import React from 'react';
import ReactDOM from 'react-dom';

const currTime = new Date();
const tt = currTime.getHours();
console.log(tt);
const greeting = "";

if(tt >= 3 && tt <= 11)
  greeting = "Good Morning";
else if(tt >= 12 && tt <= 18){
  greeting = "Good Afternoon";
}
else
  greeting = "Good Night";

// console.log(greeting);

ReactDOM.render(
  <h1>hello world</h1>
  ,
  document.getElementById('root')
